import React from 'react';
import ReactDOM from 'react-dom';

function App() {
    return (
        <div>
            <h2>Counter: </h2>
            <button>In</button>
        </div>
    )
}
const app = (<App />)
ReactDOM.render(app, document.getElementById('root'));
